import React from 'react';

function Packages() {
  return (
    <div className="bg-white min-h-screen p-4">
      <h1 className="mb-4">Packages</h1>
      
      <div className="grid grid-cols-2 gap-4">
        <div className="bg-gray-200 p-4">
          {/* Content for Part 1 */}
        </div>
        <div className="bg-gray-200 p-4">
          {/* Content for Part 2 */}
        </div>
      </div>
    </div>
  );
}

export default Packages;
